(614, 'খাঁটি গাওয়া ঘি ২০০ গ্রাম', '0614', '002', 'ghi-400gm-202101161610802080.webp', 'null', 'মুদি', 'বিবিধ', 'শুদ্ধ', '0', 285.00, '285', '0', 'PCS', '', '', '<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t10/1/16/1f449_1f3ff.png\" alt=\"????????\" width=\"16\" height=\"16\" /></span><strong>খাঁটি গাওয়া ঘী</strong><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t4f/1/16/1f448_1f3ff.png\" alt=\"????????\" width=\"16\" height=\"16\" /></span></div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">গরম ভাতে গাওয়া ঘী, আহা কি ঘ্রাণ।</div>\n<div dir=\"auto\">সুস্বাস্থ্যের জন্য খাঁটি গাওয়া ঘী এর উপকারীতা এখন মোটামুটি সকলেরই জানা।</div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t10/1/16/1f449_1f3ff.png\" alt=\"????????\" width=\"16\" height=\"16\" /></span>ঠান্ডায় ঘী এর ব্যবহার গরমের তুলনায় অনেক বেশি। সর্দি কাশিতে সারাতে, শারীরিক দুর্বলতা কাটতে</div>\n<div dir=\"auto\">ঘী এর ব্যবহার অনেক বেশি।</div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t10/1/16/1f449_1f3ff.png\" alt=\"????????\" width=\"16\" height=\"16\" /></span>শুষ্ক ত্বককে মৃসন করতে ঘী এর তুলনা নেই।</div>\n<div dir=\"auto\">প্রতিদিন ত্বকের মশ্চারাইজার লাবন্য করতে হাতের তালুতে ১চামচ ঘী গোসলের আগে মুখে লাগান।</div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t10/1/16/1f449_1f3ff.png\" alt=\"????????\" width=\"16\" height=\"16\" /></span>ঘী এর সাথে পেয়াজ ভেজে খেলে গলা ব্যাথার উপশম হয় এবং দ্রুত তা থেকে নিরাময় পাওয়া যায়।</div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t10/1/16/1f449_1f3ff.png\" alt=\"????????\" width=\"16\" height=\"16\" /></span>শরীরকে গরম রাখে, চোখের ক্লান্তি ভাব দূর করে,</div>\n<div dir=\"auto\">ঠোঁটকে সতেজ রাখে ঠান্ডায় প্রতিদিন ঘী ব্যবহারের ফলে।</div>\n<div dir=\"auto\">2-5 দিনের মধ্যে হোম ডেলিভারি দেয়া হয়।&nbsp;</div>\n</div>', 0, '', 'super', 1, 46.00, 0.00, 'yes', 19),
