(623, 'বাঁশীরাজ লাল চাল ঢেঁকি ছাঁটা ফুল ফাইবার ১ কেজি', '0623', '008', 'lal-chal-dheki-202102011612160481.webp', NULL, 'মুদি', 'চাল', 'শুদ্ধ', '0', 95.00, '95', '0', 'Kg', '', '', '<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><strong>লাল চালের ভাতের উপকারিতা:</strong></div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">১. অ্যাজমা প্রতিরোধে পালমোনারি ফাংশনকে নিয়ন্ত্রণ করে লাল চাল। এই চালে রয়েছে ম্যাগনেশিয়াম যা দেহের অক্সিজেনের সার্কুলেশন ঠিক রাখে। অ্যাজমা প্রতিরোধে সাহায্য করে লাল চালের ভাত।</div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">২. লাল চালের আছে আয়রন। খেলে অক্সিজেন শোষণে সাহায্য করে এবং দেহের সব সেল এবং টিস্যুতে অক্সিজেন পৌঁছে দেয়। দেহে অক্সিজেনের মাত্রা ঠিক থাকলে আপনি থাকবেন অ্যানার্জিতে ভরপুর।</div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">৩. হজমে সাহায্য লাল চালের ফাইবারের দুর্দান্ত উৎস। এটি দেহ থেকে টক্সিন বের করে অন্ত্র ঠিক রাখতে সাহায্য করে।</div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">৪. লাল চালের ভাত খেলে হার্ট ভালো থাকে। লাল চালে থাকা উপাদান দেহে খারাপ কোলেস্টেরলের লেভেল কমাতে সাহায্য করে। কোলেস্টেরলের মাত্রা ঠিক থাকলে হার্টের সমস্যাও থাকবে দূরে।</div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">৫. ভিটামিন বি-৬ এর ভালো উৎস হচ্ছে লাল চালের ভাত। লোহিত রক্তকণিকা তৈরিতে ভিটামিন বি-৬ লাগে। এর অভাবে একাধিক অসুস্থতা বাসা বাঁধবে শরীরে।</div>\n</div>', 0, '', 'super', 1, 50.00, 0.00, 'yes', 0),
